import React from 'react';

const team = [
  {
    name: 'Shubham Patel',
    role: 'Founder & Lead Developer',
    bio: 'Passionate about building creative digital solutions and helping businesses grow online.',
    img: '', // You can add image URLs here if available
    color: '#2ECC71',
  },
  {
    name: 'Team Member',
    role: 'Web Designer',
    bio: 'Expert in modern web design and user experience.',
    img: '',
    color: '#0057D9',
  },
];

function Team() {
  return (
    <div style={{ background: '#F5F5F5', minHeight: '100vh', padding: '0 0 2rem 0' }}>
      <section style={{
        maxWidth: '900px',
        margin: '0 auto',
        padding: '3rem 1rem',
      }}>
        <h1 style={{ color: '#0057D9', fontWeight: 800, fontSize: '2.5rem', marginBottom: '2.5rem', textAlign: 'center', letterSpacing: '1px' }}>
          Our Team
        </h1>
        <div style={{
          display: 'flex',
          flexWrap: 'wrap',
          gap: '2rem',
          justifyContent: 'center',
        }}>
          {team.map(member => (
            <div key={member.name} style={{
              background: '#fff',
              borderRadius: '1.2rem',
              boxShadow: '0 2px 12px rgba(0,0,0,0.06)',
              padding: '2.2rem 1.5rem',
              textAlign: 'center',
              minWidth: '250px',
              maxWidth: '320px',
              flex: '1 1 250px',
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
            }}>
              <div style={{
                width: '80px',
                height: '80px',
                borderRadius: '50%',
                background: member.color,
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                color: '#fff',
                fontWeight: 800,
                fontSize: '2.2rem',
                marginBottom: '1rem',
                boxShadow: '0 2px 8px rgba(0,0,0,0.10)',
              }}>
                {member.name.split(' ').map(n => n[0]).join('')}
              </div>
              <h2 style={{ color: member.color, fontWeight: 700, fontSize: '1.3rem', marginBottom: '0.3rem' }}>{member.name}</h2>
              <div style={{ color: '#2E2E2E', fontWeight: 600, marginBottom: '0.7rem' }}>{member.role}</div>
              <p style={{ color: '#2E2E2E', fontSize: '1.05rem', lineHeight: 1.6 }}>{member.bio}</p>
            </div>
          ))}
        </div>
      </section>
    </div>
  );
}

export default Team;
